<script>
  var cookies=0;
localStorage.cookies = localStorage.cookies;
$(document).ready(function () {
  if (localStorage.cookies !=1) {
    setTimeout(function () {
      $("#cookieConsent").fadeIn(200);
    }, 2000);

});
